    <>
      <Head>
        <title>TMB Service Education</title>
      </Head>
      <div className="bg-gradient-to-b from-blue-800 to-blue-900 h-full">
        <Header></Header>
        <Etapas></Etapas>
      </div>
    </>

  );
}

export default SolicitacaoCredito;
